import { Container, Row, Col } from 'react-grid';
import React, { Button, useState, useEffect } from "react";
import { Navigate } from "react-router-dom";

function Profile() {
  const [data, setData] = useState({
    email: "",
    fname: "",
    lname: "",
    number: "",
  });

  function logout(){
    fetch("/logout", {
      method: "GET",
    })
      .then(
        <Navigate to="/"/> 
      )
      .catch(err => {
        console.log(err);
        <Navigate to="/"/> 
      });

  }

  useEffect(() => {
    fetch("/getLoggedInUserInfo", {
      method: "GET",
      headers: {'Content-Type': 'application/json'},
    })
      .then(resp => resp.json())
      .then(data => {
        if(data.status === "success"){
          console.log(data);
          let ret_data  = {
              email: data["user_email"],
              fname: data["user_fname"],
              lname: data["user_lname"],
              number: data["user_phone"],
          };
          setData(ret_data);
        }
        })
      .catch(err => console.log(err));

  }, [])


  return (
    <div className="Profile">
      <Container>
      <Row>
        <Col>
         Email 
        </Col>
        <Col>
         {data["email"]}
        </Col>
      </Row>
      <Row>
        <Col>
          First Name 
        </Col>
        <Col>
         {data["fname"]} 
        </Col>
      </Row>
      <Row>
        <Col>
          Last Name 
        </Col>
        <Col>
         {data["lname"]} 
        </Col>
      </Row>
      <Row>
        <Col>
         Phone Number 
        </Col>
        <Col>
         {data["number"]} 
        </Col>
      </Row>
    </Container>
      <Button
      onPress={logout}
      title="Learn More"
      color="#841584"
      accessibilityLabel="Learn more about this purple button"
    />
    </div>
  );
}

export default Profile;
